export default function getProfilePic(artists, artistID) {
    const artist = artists.find(artist => artist.artist_id === artistID);
    return artist ? artist.profile_pic_path : 'https://firebasestorage.googleapis.com/v0/b/music-player-28fb2.firebasestorage.app/o/pics%2Fdefault-profile-account-unknown-icon-black-silhouette-free-vector.jpg?alt=media&token=7a4dcede-f6c3-46d6-ba83-2832b0fb2ce1';

}
